import StatsForm from "../components/StatsForm.js";
import Fixture from "../components/Fixture.js";


class stats extends React.Component {
  constructor(props) {
      super(props);
        this.state = {
          dropdownCountry: [{value: "eng", label: "England"},{value: "fra", label: "France"},
          {value: "ger", label: "Germany"},
          {value: "spa", label: "Spain"},
          {value: "ita", label: "Italy"}],
          dropdownLeague: [],
          dropdownFixture: []
      };
    }

  render() {
    return (
        <div>
          <JumboStats/>
          <CTABonus3 />
          <StatsTitle />
          <StatsForm />
          <Fixture />
        </div>
    )
  }
}

export default stats;
